import Navbar from "./navbar";
import SearchBar from "./search";
import AnCIcons from "./ancicons";


function Header(){
    return (
        <div className="header" style={{display:"flex"}}>
            <SearchBar />
            <Navbar />
            <AnCIcons />
        </div>
    )
}

export default Header;
